$(document).on("click", ".redirect", function() {
    var location = $(this).find(".redirectLink").attr("href");
    if ($(this).find(".redirectLink").attr("target") == "_blank") {
        window.open(location);
    }
    else {
        window.location.href = location;
    }
    
    return false;
});